import React from 'react';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';




function App() {
  const classes = useStyles();

  return (
    <div className="App">
      <header className="App-header">
        <p>
          TKC Class Schedule: First Class Scheduler
        </p>
        <Grid
          container
          spacing = {3}
          direction="column"
          justify="flex-start"
          alignItems="center"
          >
          <Grid item xs={12}>
            <Paper className = {classes.kidClass} >xs=12</Paper>
          </Grid>
          <Grid item xs={12} sm={6}>
            <Paper className = {classes.otherClass}>xs=12</Paper>
          </Grid>
          <Grid item xs={12} sm={6}>
            <Paper className = {classes.otherClass}>xs=12</Paper>
          </Grid>
        </Grid>
      </header>
    </div>
  );
}

export default App;

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  kidClass: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    height: 40
  },
  otherClass: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    height: 30
  }
}));
